import "./App.css";
import {  Routes, Route, useNavigate } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import Home from "../src/component/userViewHome";
import Shop from "../src/component/userViewShop";
import Blog from "../src/component/userView/Blog";
import Login from "Login";
import Signup from "./Signup";
import Contactus from "./Contactus";
import Cart from "./Cart";
import Display from "./Display";
import ErrorPage from "./ErorrPage";
import { useState } from "react";
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img
          src="https://cdn-icons-png.flaticon.com/512/76/76180.png"
          className="App-logo"
          alt="logo"
        />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://cdn-icons-png.flaticon.com/512/76/76180.png"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <Routes>
      <Route exact path="/" element={<Home />}></Route>
      <Route path="/shop" element={<Shop />}></Route>
      <Route path="/blog" element={<Blog />}></Route>
      <Route path="/contactus" element={<Contactus />}></Route>
      <Route path="/login" element={<Login />}></Route>
      <Route path="/signup" element={<Signup />}></Route>
      <Route path="/cart" element={<Cart />}></Route>
      <Route path="/display/:id" element={<Display />}></Route>
      <Route path="*" element={<ErrorPage />}></Route>
    </Routes>
    </div>
  );
}

export default App;
